function calculateDominicanPayroll(n){if("number"!=typeof n)return null;const l=.0304*n,t=.0287*n,e=l+t,o=n-e;let a=0;const i=34685,r=52027.4167,s=72260.25;if(o>=i&&o<=r){a=.15*(o-i)}else if(o>=r&&o<=s){a=2601.33+.2*(o-r)}else if(o>=s){a=6648+.25*(o-s)}const c=e+a;return{monthlySalary:n,netMonthlySalary:n-c,sfs:l,afp:t,isr:a,deductions:c}}